import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import ListGroup from 'react-bootstrap/ListGroup';
import Card from 'react-bootstrap/Card';
import './riders.css';
import Navbar from '../navSection/Navbar';

const RiderCard = () => {
  return (
    <div>
      <Navbar />
      <Container>
        <Card className=" my-4 border-0" variant="flush">
          <div className="d-flex justify-content-center   align-items-center gap-3">
            <div className="imageRide">
              <img src="/images/ghanajolof.jpg" alt="" />{' '}
            </div>
            <div>
              <Card.Text className="text-end px-3">
                Available balance: <strong>N17,000.00</strong>
              </Card.Text>
              <Card.Title className="text-capitalize">Rider test</Card.Title>
            </div>
          </div>
          {/* Add the URL of the rider's image */}
          <Card.Body className=" ">
            <ListGroup className="list-group-flush">
              <ListGroup.Item>Rating: ★★★★☆</ListGroup.Item>
              <ListGroup.Item>Status: 173 rides completed</ListGroup.Item>
              <ListGroup.Item>Delivery duration: 30m</ListGroup.Item>
              <ListGroup.Item>30km away</ListGroup.Item>
              <ListGroup.Item>
                {' '}
                <div>
                  {' '}
                  <strong>Reviews(36)</strong>
                  <div className='d-flex align-items-center'>
                    <div className="imageReview">
                      <img src="/images/ghanajolof.jpg" alt="" />{' '}
                     
                    </div>
                    <span> Test1  nice doing business with you</span>
                  </div>
                  <div className="text-center">
                    <Button variant="primary">See More</Button>
                  </div>
                </div>
              </ListGroup.Item>
            </ListGroup>
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};

export default RiderCard;
